class Solution:
    def numberOfRoutes(self, grid: List[str], d: int) -> int:
        m,n = len(grid),len(grid[0])
        mod = 10**9+7
        @cache
        def dfs(i,j,op):#
            if i == -1:
                return 1 
            ret = 0 
            if i ==0:
                ret +=1                
            for k in range(n):
                if i != 0 and(grid[i-1][k] == "." and 1+ (j-k)**2 <= d**2 ):
                    ret += dfs(i-1,k,1)
                    #print(i-1,k, dfs(i-1,k,1),"a")
            if op ==1:
                for k in range(n):
                    if k != j and abs(k-j)<=d and grid[i][k] ==".":
                        ret += dfs(i,k,0)

            return ret %mod 
        sm = 0 
        for i in range(n):
            if grid[m-1][i] ==".":
                sm += dfs(m-1,i,1)
                #print(i,sm)
        return sm%mod



